import { Grid } from "@material-ui/core";

const HomePage = () => {
  return (
    <Grid container direction="column">
      <Grid item>Header</Grid>
      <Grid item container>
        <Grid item xs={0} sm={2} />
        <Grid item xs={8}>
          Content
        </Grid>
        <Grid item xs={0} sm={2} />
      </Grid>
    </Grid>
  );
};

export default HomePage;
